Eva Jacqueline Longoria Parker (born March 15, 1975) is a Golden Globe Award-nominated American film and television actress. She plays Gabrielle Solis in the ABC television series Desperate Housewives, and stars in the film Over Her Dead Body. She has also become a nationally recognized model after appearing in several high-profile advertising campaigns and numerous men&amp;#039;s magazines, reaching #14 in the FHM &quot;Sexiest Women 2008&quot; poll.
